import React from "react";
import { SpreadSheets, Worksheet } from "@grapecity/spread-sheets-react";
import { IO } from "@grapecity/spread-excelio";
import jsonData from "./data/spreadJson.json";

let spread = null;

function SpreadSheetJS(props) {
  return (
    <div>
      <SpreadSheets
        hostStyle={{ width: "100%", height: "600px" }}
        workbookInitialized={(spread) => initSpread(spread)}
      >
        <Worksheet></Worksheet>
      </SpreadSheets>
    </div>
  );
}
function initSpread(spread_local) {
  spread = spread_local;
  spread.options.calcOnDemand = true;
  spread.fromJSON(jsonData);
}

export default SpreadSheetJS;
